import React from 'react'
import { Navigate } from 'react-router-dom';
function RightRegisterForm() {
    const navigate = navigate();
    return (
      <>
        <h1>Contact Page</h1>
        <br />
        <button onClick={() => history.goBack()}>Go Back</button>
      </>
    );
}

export default RightRegisterForm
